import React from 'react';
import styled from 'styled-components';

const SecondFoldWrapper = styled.div`
  width: 100%;
  background-color: #FFFFFF;
  padding: 32px 40px;

  .list {
    padding-left: 0;
    list-style: none;
    margin-bottom: 32px;
    display: flex;
    align-items: center;
    justify-content: space-around;

    li {
      color: #748c02;
      font-weight: 700;
      text-transform: uppercase;
      font-size: 22px;
      line-height: 1.09;
      letter-spacing: -0.25px;
      text-align: center;

      img {
        display: block;
        margin: 0 auto 16px;
      }
    }
  }
`;

const SecondFold = () => {
  return (
    <SecondFoldWrapper>
      <ul className="list">
        <li>
          <img src="./images/window.png" alt="window" />
          Windows
        </li>
        <li>
          <img src="./images/siding.png" alt="siding" />
          Siding
        </li>
        <li>
          <img src="./images/roof.png" alt="roof" />
          Roof
        </li>
      </ul>
    </SecondFoldWrapper>
  );
};

export default SecondFold;
